INSERT INTO `articlei18n` VALUES ('430f542c-1d58-11e4-8911-54271e04d158','4ce235d3-1d18-11e4-a7b6-54271e04d158',NULL,'430f486e-1d58-11e4-8911-54271e04d158','id','Alat Musik Angklung','alat-musik-angklung','<p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><img src=\"http://kebudayaanindonesia.net/media/images/timthumb.php?src=upload/culture/angklung-instrument.jpg&w=300&q=100\" alt=\"angklung-instrument.jpg\" style=\"color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 1.42857143; float: left;\"><strong>Angklung</strong>Â adalah alat musik bambu yang dimainkan dengan cara digetarkan. Suara yang dihasilkan adalah efek dari benturan tabung-tabung bambu yang menyusun instrumen tersebut. Instrumen ini digolongkan ke dalam jenis idiofon atau alat music yang sumber bunyinya berasal dari bahan dasarnya. Angklung umumnya dikenal berasal dari daerah Jawa Barat. Sejak November 2010, UNESCO menetapkannya sebagai salah satu warisan kebudayaan dunia, dengan kategori Masterpiece of Oral and Intangible Heritage of Humanity.</p><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><br><strong>Etimologi</strong><br>Kata<strong>Â angklung</strong>Â konon berasal dari Bahasa Sunda (<strong>angkleung-angkleungan</strong>), yang menggambarkan gerak tubuh para pemain Angklung yang berayun-ayun seiring irama yang dibunyikan. Namun, ada juga yang meyakini kata<strong>angklung</strong>Â berasal dariÂ Â <strong>klung</strong>, tiruan bunyi instrumen bambu tersebut. Sementara satu teori lainnya menyebutkan, kata â€œangklungâ€ berasal dari Bahasa Bali, yakni<strong>angka</strong>Â danÂ <strong>lung</strong>. Angka berartiÂ <strong>nada</strong>, sedangkanÂ <strong>lung</strong>Â berartiÂ Â <strong>patah</strong>Â , atau dengan kata lain,<strong>Â angklung</strong>Â bermaknaÂ <strong>nada yang tidak lengkap</strong>.</p><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><strong>Sejarah Angklung</strong><br>Menurut Dr. Groneman, Angklung telah ada di tanah Nusantara, bahkan sebelum era Hindu. Menurut Jaap Kunst dalam bukunya Music in Java, selain di Jawa Barat, Angklung juga bisa ditemui di daerah Sumatra Selatan dan Kalimantan. Di luar itu, masyarakat Lampung, Jawa Timur dan Jawa Tengah juga mengenal alat musik tersebut.</p><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><br>Di era Hindu, pada era Kerajaan Sunda, Angklung menjadi instrumen penting dalam berbagai perayaan, terutama yang berkenaan dengan ritus bercocok-tanam, khususnya padi. Di lingkungan Kerajaan Sunda, tercatat sejak abad ke-7, Angklung dimainkan sebagai bentuk pemujaan terhadap Dewi Sri (dewi padi/dewi kesuburan), agar Dia melimpahkan berkahnya atas tanaman dan kehidupan masyarakat. Tidak hanya sebagai media penyembahan terhadap dewa-dewi, pada zaman Kerajaan Sunda, Angklung juga merupakan alat musik yang dimainkan sebagai pemacu semangat dalam peperangan, termasuk dalam Perang Bubat, sebagaimana yang diceritakan dalam Kidung Sunda.</p><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><br>Hari ini, Angklung Gubrag merupakan instrument Angklung tertua yang masih terawat. Angklung tersebut dibuat pada abad ke-17 di Jasinga, Bogor. Angklung kuno lainnya yang juga masih bisa dilacak keberadaannya terdapat di Museum Sri Baduga, Bandung. Sementara itu, tradisi Angklung yang paling lawas bisa didapati di lingkungan masyarakat Kanekes (Baduy), tepatnya di daerah Lebak, Banten. Hingga hari ini, mereka masih memfungsikan angklung sebagai mana yang diwariskan para leluhurnya, yakni mengiringi ritus bercocok-tanam.</p><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><br>Pada 1938, Daeng Soetigna, warga Bandung, menciptakan angklung dengan tangga nada diatonis. Angklung inovasi Daeng Sutigna tersebut berbeda dengan angklung pada umumnya yang berdasarkan tangga nada trradisional pelog atau salendro. Inovasi inilah yang kemudian membuat Angklung dengan leluasa bisa dimainkan harmonis bersama alat-alat musik Barat, bahkan bisa disajikan dalam bentuk orkestra. Sejak saat itu, Angklung semakin menuai popularitas, hingga akhirnya PBB, melalui UNESCO, pada 18 November 2012, mengakuinya sebagai sebuah warisan dunia yang harus dilestarikan. Setelah Daeng Soetigna, salah seorang muridnya, Udjo Ngalagena, meneruskan usaha Sang Guru mempopulerkan Angklung temuannya, dengan jalan mendirikan â€œSaung Angklungâ€ di daerah Bandung. Hingga hari ini, tempat yang kemudian dikenal sebagai â€œSaung Angklung Udjoâ€ tersebut masih menjadi pusat kreativitas yang berkenaan dengan Angklung</p><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><br><strong>Jenis-jenis Angklung</strong></p><ul style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 25px; text-align: justify;\"><li style=\"line-height: 25px; list-style-type: disc;\"><strong>Angklung Kanekes</strong></li></ul><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><strong>Angklung Kanekes</strong>Â adalah Angklung yang dimainkan oleh masyarakat Kanekes (Baduy), di daerah Banten. Sebagaimana disinggung sebelumnya, tradisi Angklung yang ada pada masyarakat Kanekes ini terbilang kuno, dan tetap dilestarikan sebagaimana fungsi yang dicontohkan leluhur mereka, yakni mengiringi ritus bercocok-tanam (padi). Pada masyarakatÂ  Kanekes, yang terbagi menjadi dua kelompok, yakni kelompok Baduy Luar (Kajeroan) dan kelompok Baduy (Luar Kaluaran), yang berhak membuat Angklung hanyalah warga Baduy Jero, itu pun tidak semua orang, melainkan hanya mereka yang menjadi keturunan para pembuat Angklung. Sementara itu, warga Baduy Luar tidak membuat Angklung, melainkan cukup membelinya dari warga Baduy Jero. Nama-nama Angklung di Kanekes dari yang terbesar adalah: indung, ringkung, dongdong, gunjing, engklok, indung leutik, torolok, dan roel.</p><ul style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 25px; text-align: justify;\"><li style=\"line-height: 25px; list-style-type: disc;\"><strong>Angklung Dogdog Lojor</strong></li></ul><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\">Kesenian Dogdog Lojor terdapat di lingkungan masyarakat Kasepuhan Pancer Pangawinan, yang mendiami sekitar Gunung Halimun, yang berbatasan dengan wilayah Jakarta, Bogor, dan Lebak. Istilah Dogdog Lojor sendiri sejatinya diambil dari nama salah satu instrumen dalam tradisi ini, yakni Dogdog Lojor. Namun demikian, Angklung juga mendapatkan porsi yang tidak kalah penting di sini, terutama dalam fungsi tradisinya, yakni sebagai pengiring ritus bercocok-tanam. Setelah masyarakat di sana menganut Islam, dalam perkembangannya, kesenian tersebut juga digunakan untuk mengiringi khitanan dan perkawinan. Dalam kesenian Dogdog Lojor, terdapat 2 intrumen Dogdog Lojor dan 4 instrumen angklung besar.</p><ul style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 25px; text-align: justify;\"><li style=\"line-height: 25px; list-style-type: disc;\"><strong>Angklung Badeng</strong></li></ul><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\">Badeng merupakan kesenian yang menggunakan Angklung sebagai instrument utamanya. Kesenian Badeng terdapat di Desa Sanding, Kecamatan Malangbong, Garut. Seiring dengan perkembangan Islam, Kesenian Badeng juga digunakan untuk kepentingan dakwah dan juga hiburan. Namun demikian, diyakini Angklung dalam kesenian Badeng juga memiliki akar tradisi yang sama, yakni sebagai pengiring ritus bercocok-tanam. Dalam kesenian Badeng, dimainkan 9 buah Angklung, yakni 2 angklung roel, 1 angklung kecer, 4 angklung indung dan angklung bapa, 2 angklung anak; 2 buah dogdog, 2 buah terbang atau gembyung, serta 1 kecrek.<br>Selain tiga tradisi kesenian Angklung di atas, banyak daerah lain di Jawa Barat yang juga mewarisi tradisi Angklung, sebut saja Angklung Buncis (Priangan/Bandung), Angklung Badud (Priangan Timur/Ciamis), dan Angklung Bungko (Indramayu).</p><ul style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 25px; text-align: justify;\"><li style=\"line-height: 25px; list-style-type: disc;\"><strong>Angklung Padaeng</strong></li></ul><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\">Angklung Padaeng adalah Angklung yang sekarang banyak dikenal luas, yakni Angklung hasil inovasi Daeng Soetigna, yang menggunakan tangga nada diatonis. Sejalan dengan teori musik, Angklung Padaeng secara khusus dikelompokan ke dalam dua, yakni: angklung melodi dan angklung akompanimen. Angklung melodi adalah yang secara spesifik terdiri dari dua tabung suara dengan beda nada 1 oktaf. Pada satu unit angklung, umumnya terdapat 31 angklung melodi kecil dan 11 angklung melodi besar. Sementara itu, angklung akompanimen adalah angklung yang digunakan sebagai pengiring untuk memainkan nada-nada harmoni. Tabung suaranya terdiri dari 3 sampai 4, sesuai dengan akor diatonis. Setelah inovasi Daeng Soetigna, pembaruan-pembaruan lainnya terhadap angklung terus berkembang. Beberapa di antaranya adalah: Angklung Sarinande, Arumba, Angklung Toel, dan Angklung Sri Murni.</p><p style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); margin-bottom: 25px; line-height: 25px; padding: 0px; text-align: justify;\"><br><strong>Teknik Bermain Angklung</strong><br>Memainkan sebuah angklung pada dasarnya sangat mudah, yakni satu tangan memegang rangka angklung, dan tangan yang lain menggoyangkannya hingga menghasilkan bunyi. Terdapat tiga teknik dasar menggoyangkan angklung, yakni:</p><ul style=\"font-family: \'Open Sans\', \'PT Sans\', pt_sansregular, sans-serif; color: rgb(51, 52, 57); padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 25px; text-align: justify;\"><li style=\"line-height: 25px; list-style-type: disc;\">Kurulung (getar), merupakan teknik yang paling umum dipakai, di mana satu tangan memegang rangka angklung, dan tangan lainnya menggoyangkan angklung selama nada yang diinginkan, hingga tabung-tabung bambu yang ada silih beradu dan menghasilkan bunyi.Â Â </li><li style=\"line-height: 25px; list-style-type: disc;\">Cetok (sentak), yakni teknik di mana tabung dasar ditarik dengan cepat oleh jari ke telapak tangan kanan, sehingga angklung akan berbunyi sekali saja (stacato).</li><li style=\"line-height: 25px; list-style-type: disc;\">Tengkep, yakni teknik yang mirip seperti kurulung, namun salah satu tabung ditahan tidak ikut bergetar.</li></ul>                \r\n                ','publish','2014-08-06 17:56:06',NULL);
